const { Client, Collection, discord } = require("discord.js");
const fs = require("fs");

// Create a new Discord client
const client = new Client({ intents: discord.Intents.ALL });

// Define a collection of commands for the bot
client.commands = new Collection();

// Read the commands from the commands folder
const commandFiles = fs.readdirSync("./commands").filter(file => file.endsWith(".js"));

// Import each command and add it to the collection
for (const file of commandFiles) {
    const command = require(`./commands/${file}`);
    client.commands.set(command.data.name, command);
}

// Define the slash command
client.on("ready", () => {
    console.log(`Bot is ready and logged in as ${client.user.tag}`);

    // Enable slash commands for the bot
    client.commands.forEach(command => {
        client.application.commands.create({
            name: command.data.name,
            description: command.data.description
        });
    });
});

// Define the slash command interaction
client.on("interactionCreate", async interaction => {
    if (!interaction.isCommand()) return;

    const command = client.commands.get(interaction.commandName);

    try {
        await command.execute(interaction);
    } catch (error) {
        console.error(error);
        await interaction.reply({ content: "There was an error while executing this command!", ephemeral: true });
    }
});

// Define the bot token
const token = "YOUR_BOT_TOKEN";

// Start the bot
client.login(token);
```
