```javascript
const { Client, Collection } = require("discord.js");

// Create a new Discord client
const client = new Client({ intents: [
  "Guilds",
  "GuildMessages",
  "GuildMessageComponents",
  "MessageContent"
] });

// Create a new collection for commands
client.commands = new Collection();

